import { Pagination } from 'react-bootstrap';
import React, { useState } from 'react';


const dogImages = [
    ["/dog1.jpg", "/dog2.jpg", "/dog3.jpg", "/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    ["/dog4.jpg", "/dog5.jpg", "/dog6.jpg"],
    // 추가 이미지 배열
];

const Straydog = () => {
    const [currentPage, setCurrentPage] = useState(0);

    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
            <h1>입양견</h1>

            <table>
                <tbody>
                    <tr>
                        {dogImages[currentPage].map((dogImage, index) => (
                            <td key={index}><img src={dogImage} alt={`Dog ${currentPage * 3 + index + 1}`} width="300" height="300" /></td>
                        ))}
                    </tr>
                </tbody>
            </table>

            <Pagination>
                <Pagination.Prev onClick={() => setCurrentPage(oldPage => Math.max(oldPage - 1, 0))} />
                {dogImages.map((_, index) => (
                    <Pagination.Item key={index} active={index === currentPage} onClick={() => setCurrentPage(index)}>
                        {index + 1}
                    </Pagination.Item>
                ))}
                <Pagination.Next onClick={() => setCurrentPage(oldPage => Math.min(oldPage + 1, dogImages.length - 1))} />
            </Pagination>
        </div>
    );
};
export default Straydog
